const sidebarNavItems = [
  {
    display: "Movies",
    icon: <i className="bx bx-chevron-down"></i>,
    section: "Movies",
    subItems: [
      {
        display: "Movies"
      }
    ],
  },
  {
    display: "People",
    icon: <i className="bx bx-chevron-down"></i>,
    section: "People",
    subItems: [
      {
        display:"People",
      }
    ],
  },
  {
    display: "Planets",
    icon: <i className="bx bx-chevron-down"></i>,
    section: "Planets",
    subItems: [
      {
        display:'Planets',
        to:'/planets'
      }
    ],
  },
  {
    display:'Species',
    icon: <i className="bx bx-chevron-down"></i>,
    section: "Species",
    subItems: [
      {
        display:'Species',
      }
    ],
  },
  {
    display:'StarShips',
    icon: <i className="bx bx-chevron-down"></i>,
    section: "Starships",
    subItems: [
      {
        display:'Starships',
      }
    ],
  },
];

export default sidebarNavItems;
